You can achieve this by creating a singleton instance of the `TooltipProvider` and using it to wrap each individual component that uses the `Tooltip` component. Here's an example of how you can do this:

\begin{code}
import React from 'react';
import { useState, createContext, useContext } from 'react';

const TooltipContext = createContext();

const tooltipProviderInstance = (() => {
  const [tooltip, setTooltip] = useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return { openTooltip, closeTooltip };
})();

export const TooltipProvider = ({ children }) => {
  return (
    <TooltipContext.Provider value={tooltipProviderInstance}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => {
  return useContext(TooltipContext);
};

export const Tooltip = ({ children }) => {
  const { openTooltip, closeTooltip } = useTooltip();

  const handleMouseOver = () => {
    closeTooltip(); // Close the previously opened tooltip
    openTooltip(children);
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {children}
    </div>
  );
};

export const TooltipContent = ({ children }) => {
  const { tooltip } = useTooltip();

  if (!tooltip) return null;

  return {tooltip};
};
\`

