In a library or book order platform, inconsistent file structure issues can lead to i18n violations. Here are some examples:

**Example 1: Hardcoded Strings**

In a file named `book.js`, we have the following code:
```javascript
// book.js
const bookTitle = 'The Great Gatsby';
const bookAuthor = 'F. Scott Fitzgerald';

// ...
```
In this example, the book title and author are hardcoded as English strings. This is an i18n violation because it assumes that all users will understand English.

**Example 2: Inconsistent File Naming**

In a file named `bookList.en.js`, we have the following code:
```javascript
// bookList.en.js
const bookList = [
  { title: 'The Great Gatsby', author: 'F. Scott Fitzgerald' },
  { title: 'To Kill a Mockingbird', author: 'Harper Lee' },
  // ...
];
```
In this example, the file name `bookList.en.js` suggests that it contains English translations, but the file content is not properly organized to support multiple languages.

